" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Parotid gland enlargement in Sj&ouml;gren's syndrome on magnetic resonance imaging",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 244px; height: 356px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sj&ouml;gren's syndrome can lead to massive salivary gland enlargement,&nbsp;which is shown here&nbsp;on magnetic resonance imaging (MRI). MRI studies should be performed with gadolinium and with \"fat subtraction\" to permit evaluation of the ductal system.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Fox, MD, PhD.",
"    </div>",
