var title_f23_41_24218="Facial nerve anatomy";
var content_f23_41_24218=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F55677&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F55677&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 557px\">",
"   <div class=\"ttl\">",
"    Cranial nerve VII (facial nerve) anatomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 790px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The facial nerve provides motor innervation to all the muscles of facial expression and the three muscle derivatives of the second pharyngeal arch (posterior digastric, stapedius, and stylohyoid). It parasympathetically fires three of the four glands in the head: the submandibular and sublingual salivary glands, and the lacrimal gland (A). Other parasympathetic fibers stimulate mucous secretion in the nose and palate. Taste fibers from the anterior two-thirds of the tongue follow the path of the lingual branch of cranial nerve (CN) V until just before entering the cranium as a distinct chorda tympani nerve (B).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Moore, KL, Agur, AMR. Essential Clinical Anatomy, 2nd Edition. Baltimore, Lippincott Williams &amp; Wilkins, 2002. Copyright &copy; 2002 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
